function Propos()
{
    return(
        <div className="w-full h-screen transition-all duration-300">
            <div className="grid w-full h-full grid-cols-1 gap-5 bg-green-300">
                <div className="h-20 bg-blue-400">Header</div>
                <div className="bg-red-400">Body</div>
                <div className="h-20 bg-yellow-400">Footer</div>
            </div>
        </div>
    );
}
export default Propos;
